package Package1;

public class SwapTwoNum {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 10, b = 20;
		System.out.println("Before "+ a + " " + b);
		int temp;
		temp = a;
		a = b;
		b = temp;
		System.out.println("After " + a + " " + b);
	}

}
